import React from "react";
import logo from "./logo.svg";
import "./App.css";

import ShoppingSite from "./Components/ShoppingSite";
import store from "./Store";

function App() {
  return (
    <div className="App">
      <ShoppingSite store={new store.Products()} />
    </div>
  );
}

export default App;
